const INITIAL_STATE = {
  isSignedIn : null,
  userId:null
};




const FetchUser = (state = INITIAL_STATE, action) => {
    switch(action.type){
      case SIGN_IN:
            return {...state , isSignedIn:true,userId:action.payload};

        case SIGN_OUT:
            return{...state,isSignedIn:false,userId:action.payload};

      case "CREATE_USER":
      return action.payload;
      case "LOGIN_USER":
      return action.payload ;    
       case "POST_LIST" :
       return action.payload ;   
       case "CREATE_POST" :
       return action.payload ;   
       default:
      return state;
    }
  }

export default FetchUser;
